const GOOGLE_API_KEY = "AIzaSyAnbbstU-FTLUf79odSuvJWWfTfHTA_ONM";

export function getMapPreview() {
  const imageURL = `https://maps.googleapis.com/maps/api/staticmap?center=${lat},${lng}&zoom=13&size=400x400&maptype=roadmap
    &markers=color:red%7Clabel:S%7C${lat},${lng}
    &key=${GOOGLE_API_KEY}&signature=YOUR_SIGNATURE`;

  return imageURL;
}
